  .tabs {
    position: relative;
    margin: 3rem 0;
    background: #0088ce;
    height: 14.75rem;
  }
  .tabs::before,
  .tabs::after {
    content: "";
    display: table;
  }
  .tabs::after {
    clear: both;
  }
  .tab {
    float: left;
  }
  .tab-switch {
    display: none;
  }
  .tab-label {
    position: relative;
    display: block;
    line-height: 2.75em;
    height: 3em;
    padding: 0 1.618em;
    background: #0088ce;
    // border-right: 0.125rem solid #0088ce;
    color: #fff;
    cursor: pointer;
    top: 0;
    transition: all 0.25s;
  }
  .tab-label:hover {
    top: -0.25rem;
    transition: top 0.25s;
  }
  .tab-content {
    height: 12rem;
    position: absolute;
    z-index: 1;
    top: 2.75em;
    left: 0;
    padding: 1.618rem;
    background: #ffff;
    color: #2c3e50;
    border-bottom: 0.15rem solid #0088ce;

    opacity: 0;

  }
  .tab-switch:checked + .tab-label {
    background:#ffff;
    color: #2c3e50;
    border-bottom: 0;
    border-right: 10px solid #fff;
    border-left: 10px solid #fff;
    transition: all 0.35s;
    z-index: 1;
    top: -0.0625rem;
  }
  .tab-switch:checked + label + .tab-content {
    z-index: 9999;
    opacity: 1;
 
  }

